import React from "react";
import { Link } from "react-router-dom";
import "./Header.css";

const Header = () => {
  return (
    <header className="header">
      <div className="container">
        <div className="row align-items-center">
          <div className="col-3">
            <img
              src="https://upload.wikimedia.org/wikipedia/commons/1/13/Logo_PTIT_University.png"
              alt="Logo"
              className="logo"
              style={{ width: "60px", height: "50px" }}
            />
          </div>
          <div className="col-6 text-center">
            <h1 className="header-title">B20DCCN297 - Nguyễn Tiến Hùng</h1>
          </div>
          {localStorage.getItem("token") !== "admin" &&
          localStorage.getItem("token") !== "client" ? (
            <div className="col-3 text-right">
              <Link to="/library/login" className="btn btn-success">
                Login
              </Link>{" "}
              <Link to="/register" className="btn btn-primary">
                Register
              </Link>
            </div>
          ) : (
            <div className="col-2 text-right">
              <button className="btn btn-danger">Log Out</button>
            </div>
          )}
        </div>
      </div>
    </header>
  );
};

export default Header;
